import { Swiper, SwiperSlide } from "swiper/react";

// Import Swiper styles
import "swiper/css";
import "swiper/css/pagination"


const AmazingProduct = () => {
  return (
    <div className='w-full bg-red-700'>
      <div className='container mx-auto'>
        <div className='w-1/4'></div>
        <div className='w-3/4 p-2 md:p-4' dir='rtl'>
          <Swiper slidesPerView={1} spaceBetween={10} pagination={{
            "clickable": true
          }} breakpoints={{
            "@0.00": {
              "slidesPerView": 1,
              "spaceBetween": 10
            },
            "@0.75": {
              "slidesPerView": 2,
              "spaceBetween": 20
            },
            "@1.00": {
              "slidesPerView": 3,
              "spaceBetween": 40
            },
            "@1.50": {
              "slidesPerView": 4,
              "spaceBetween": 50
            }
          }} className="mySwiper">
            <SwiperSlide><img src='/photoSlider/2.jpg' alt='noLoaded' className='w-8' /></SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
            <SwiperSlide>Slide 1</SwiperSlide>
          </Swiper>
        </div>
      </div>
    </div>
  );
}

export default AmazingProduct;
